<?php
// The session data from the file
$session_data = '';

echo "=== SESSION DATA ANALYSIS ===\n\n";

// First, let's try to decode it as base64
$decoded = base64_decode($session_data);
echo "Base64 decoded length: " . strlen($decoded) . "\n";

// Check if it's a valid PHP serialized string
if (strpos($decoded, 'data|s:') === 0) {
    echo "✅ Found PHP session format: data|s:...\n";
    
    // Try to unserialize it
    $unserialized = unserialize($decoded);
    if ($unserialized !== false) {
        echo "✅ Successfully unserialized session data\n";
        echo "Session keys: " . implode(', ', array_keys($unserialized)) . "\n\n";
        
        // Look for the encrypted data
        if (isset($unserialized['data'])) {
            echo "🔍 Found encrypted session data:\n";
            echo "Data type: " . gettype($unserialized['data']) . "\n";
            echo "Data length: " . strlen($unserialized['data']) . "\n";
            echo "First 100 chars: " . substr($unserialized['data'], 0, 100) . "\n";
            echo "Last 100 chars: " . substr($unserialized['data'], -100) . "\n\n";
            
            // This is the encrypted data that needs the hm_id key to decrypt
            echo "⚠️  This data is encrypted and needs the hm_id cookie value to decrypt\n";
            echo "   The hm_id value you found: " . (isset($_GET['hm_id']) ? $_GET['hm_id'] : 'NOT PROVIDED') . "\n";
        }
    } else {
        echo "❌ Failed to unserialize session data\n";
    }
} else {
    echo "❌ Not a valid PHP session format\n";
    echo "First 50 chars: " . substr($decoded, 0, 50) . "\n";
}

echo "\n=== ANALYSIS COMPLETE ===\n";
?> 